package com.rwn.rwnstudy.utilities;public class TeacherSubjectGetterSetter {    private String Semester;    private String Subject;    private String SubjectCode;    private String collegeName;    private String course;    private String department;    private String section;    private String uid;    public TeacherSubjectGetterSetter() {    }    public TeacherSubjectGetterSetter(String Semester, String Subject, String SubjectCode, String collegeName, String course, String department, String section, String uid) {        this. Semester = Semester;        this. Subject = Subject;        this. SubjectCode = SubjectCode;        this.collegeName = collegeName;        this.course = course;        this.department = department;        this.section = section;        this.uid = uid;    }    public String getSemester() {        return Semester;    }    public TeacherSubjectGetterSetter setSemester(String Semester) {       this.Semester = Semester;        return this;    }    public String getSubject() {        return Subject;    }    public TeacherSubjectGetterSetter setSubject(String Subject) {       this. Subject = Subject;        return this;    }    public String getSubjectCode() {        return SubjectCode;    }    public TeacherSubjectGetterSetter setSubjectCode(String SubjectCode) {        this.SubjectCode = SubjectCode;        return this;    }    public String getCollegeName() {        return collegeName;    }    public TeacherSubjectGetterSetter setCollegeName(String collegeName) {        this.collegeName = collegeName;        return this;    }    public String getCourse() {        return course;    }    public TeacherSubjectGetterSetter setCourse(String course) {        this.course = course;        return this;    }    public String getDepartment() {        return department;    }    public TeacherSubjectGetterSetter setDepartment(String department) {        this.department = department;        return this;    }    public String getSection() {        return section;    }    public TeacherSubjectGetterSetter setSection(String section) {        this.section = section;        return this;    }    public String getUid() {        return uid;    }    public TeacherSubjectGetterSetter setUid(String uid) {        this.uid = uid;        return this;    }}